import React from 'react'
import commonStyles from '../../pages';

const Header = () => {
    return (
        <header className={commonStyles.appHeader}>
            <div className={commonStyles.headerContent}>
                <img
                    src="/logo-min-selhoz.png"
                    alt="Логотип Министерства сельского хозяйства"
                    className={commonStyles.logo}
                />
                <div className={commonStyles.headerTitle}>
                    <h1>Университет при Министерстве сельского хозяйства</h1>
                    <p>Система доступа к лекционному материалу на различных языках</p>
                </div>
            </div>
        </header>
    )
}

export default Header
